import React from "react";
import ReactDOM from "react-dom";
import "../css/video-react.css";

class VideoModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = { module: props.module };
  }
  render() {
    console.log(this.state.module);
    return (
      <div uk-lightbox>
        <a class="uk-button" href="video.mp4" data-poster="image.jpg" />
        <a
          class="uk-button"
          href="https://www.youtube.com/watch?v=c2pz2mlSfXA"
        />
        <a class="uk-button" href="https://vimeo.com/1084537" />
        <a class="uk-button" href="https://www.google.com/maps" />
      </div>
    );
  }
}

export default VideoModule;

